import styles from "../assets/Styles/Header.module.scss";
import userImg from "../assets/Images/profile/profile-photo-1.jpg";
export default function Header() {
  return (
    <div style={styles}>
      <img src={userImg} style={styles.userImg} />
    </div>
  );
}
